/** @format */

import React from 'react';
import { HealthList } from '../TextInfo';
import '../App.css';
import Swipe from '../components/Swipe';

const HealthBlock = ( i ) => {
    const item = i.i;
    //console.log( item );
    const background = {
        backgroundImage: `url(../images/suppliersLogo/${item.img[0]})`,
    };
    return (
        <span className='exp_block'>
            <div className='exp_location_img'>
                <span className="healthSwiperImages">
                    <div className='wrapper'>
                        <div className='main_wrapper'>
                            <Swipe for="health" idx={item.img} />
                        </div>
                    </div>
                </span>
            </div>
            <span className='exp_header'>
                <h3 className='exp_position'>{item.title}</h3>
                <p className='exp_period'>{item.subtitle}</p>
            </span>
        </span>
    );
};

export default HealthBlock;
